●自動送り機構により一定の送り量（力）を保ち無理な力が加わりません。●ハンドル振り角度は8°で切断が可能です。狭い場所での切断に威力を発揮します。●ラチェット機構の採用により狭い場所でも楽に、早く切断することができます。●ボディーはアルミ製で軽く、表面処理は耐摩耗性に優れたクロムメッキ仕上げです。●刃は専用薄刃なので、切断面がきれいです。●刃は適用管によって替刃が色分けされていますのでひと目でわかります。●PCR3-35は70mm、PCR3-66は90mmの回転半径で作業可能です。<BR>各種鋼管・ステンレス鋼管の切断。<BR>●切断能力インチ(ミリ):1/2～1 1/4(15.88～35)●最大肉厚(mm)鋼:3.2●最大肉厚(mm)ステンレス鋼:3.0●質量(kg):0.96<BR>●標準替刃:PCRK-FS<BR>●肉厚1.5mm以下のステンレス鋼管（薄肉管）の切断には、ステンレス鋼管用替刃（PCRK-S）を使用してください。<tr><td colspan="2">
